import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Customer from "./Component/customer";

const customer = {
  id: 1,
  name: "Jane",
  bday: "560711",
  gender: "Female",
  job: "Marketing",
};

function App() {
  return (
    <div className="background">
      <Customer
        name={customer.name}
        bday={customer.bday}
        gender={customer.gender}
        job={customer.job}
      />
    </div>
  );
}

export default App;
